// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "./IsCommon.sol";
import "./BetContract.sol";

contract GameContract is IsCommon {
    // PUBLIC
    constructor(
        string memory teamAName,
        string memory teamBName,
        string memory _description,
        uint256 _start,
        address _admin,
        string memory cover
    ) {
        // setting isCommon storage admin variable
        admin = _admin;
        // create new BetContract with reference to the current GameContract;
        address currentAdmin = getAdmin();
        BetContract newBetContract = new BetContract(
            address(this),
            currentAdmin
        );

        // storing game data in storage
        game = Game({
            teamA: Team({name: teamAName, score: 0}),
            teamB: Team({name: teamBName, score: 0}),
            description: _description,
            cover: cover,
            start: _start,
            gameState: GAMESTATES.INCOMING,
            betContractAddress: address(newBetContract),
            gameOutcome: GAMEOUTCOMES.NULL
        });
    }

    // getters

    function getAdmin() public view returns (address) {
        return admin;
    }

    // EXTERNAL

    function getGame()
        external
        view
        returns (
            address betContractAddress,
            string memory teamAName,
            uint256 teamAScore,
            string memory teamBName,
            uint256 teamBScore,
            string memory description,
            uint256 start,
            string memory gameState,
            string memory gameOutcome,
            string memory cover
        )
    {
        return (
            game.betContractAddress,
            game.teamA.name,
            game.teamA.score,
            game.teamB.name,
            game.teamB.score,
            game.description,
            game.start,
            this.getGameState(),
            this.getGameOutcome(),
            game.cover
        );
    }

    function getGameState() external view returns (string memory gameState) {
        if (game.gameState == GAMESTATES.INCOMING) {
            return "INCOMING";
        } else if (game.gameState == GAMESTATES.PLAYING) {
            return "PLAYING";
        } else if (game.gameState == GAMESTATES.ENDED) {
            return "ENDED";
        }
    }

    function getGameOutcome() external view returns (string memory gameOutcome) {
        if (game.gameOutcome == GAMEOUTCOMES.TEAMA) {
            return "TEAMA";
        } else if (game.gameOutcome == GAMEOUTCOMES.TEAMB) {
            return "TEAMB";
        } else if (game.gameOutcome == GAMEOUTCOMES.NULL) {
            return "NULL";
        }
    }

    function getTeamA()
        external
        view
        returns (string memory name, uint32 score)
    {
        return (game.teamA.name, game.teamA.score);
    }

    function getTeamB()
        external
        view
        returns (string memory name, uint32 score)
    {
        return (game.teamB.name, game.teamB.score);
    }

    // setters
    function setScore(string calldata _name, uint32 newScore)
        external
        isAdmin()
    {
        if (compareStr(game.teamA.name, _name)) {
            game.teamA.score = newScore;
            setGameOutcome();
            emit GameScoreChanged(game.teamA);
        } else if (compareStr(game.teamB.name, _name)) {
            game.teamB.score = newScore;
            setGameOutcome();
            emit GameScoreChanged(game.teamB);
        } else {
            revert("Team name is not valid");
        }
    }

    // setters admin

    // set GameContract gameState TO ENDED decide on game outcome and pay winners bets
    function settleGame() external isAdmin() {
        game.gameState = GAMESTATES.ENDED;
        setGameOutcome();
        BetContract betContract = BetContract(game.betContractAddress);
        betContract.setBetStateTo_TOPAY(msg.sender);
        betContract.settleBet(game.gameOutcome, msg.sender);
        betContract.setBetStateTo_PAYED(msg.sender);
        emit GameStateChanged(game.gameState);
    }

    // set GameContract gameState TO PLAYING and set betContract betState to CLOSE
    function closeBets() external isAdmin() {
        game.gameState = GAMESTATES.PLAYING;
        BetContract betContract = BetContract(game.betContractAddress);
        betContract.setBetStateTo_CLOSE(msg.sender);
        emit GameStateChanged(game.gameState);
    }

    //PRIVATE

    // find game outcome
    function getGameOutcome(uint256 teamAScore, uint256 teamBScore)
        private
        view
        isAdmin()
        returns (GAMEOUTCOMES)
    {
        if (teamAScore > teamBScore) {
            return GAMEOUTCOMES.TEAMA;
        } else if (teamBScore > teamAScore) {
            return GAMEOUTCOMES.TEAMB;
        } else {
            return GAMEOUTCOMES.NULL;
        }
    }

    // set game outcome
    function setGameOutcome() private {
        game.gameOutcome = getGameOutcome(game.teamA.score, game.teamB.score);
    }

    // utils function to compare string
    function compareStr(string memory str1, string memory str2)
        private
        pure
        returns (bool)
    {
        bytes memory bytesStr1 = bytes(str1);
        bytes memory bytesStr2 = bytes(str2);
        if (bytesStr1.length != bytesStr2.length) {
            return false;
        }
        for (uint256 i; i < bytesStr1.length; i++) {
            if (bytesStr1[i] != bytesStr2[i]) {
                return false;
            }
        }
        return true;
    }
}
